import React, { useState, useEffect } from "react";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";

function About() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const apiUrl =
      "https://world.openfoodfacts.org/api/v0/product/737628064502.json";

    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => setData(data.product.nutriments))
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src={data.image} />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
          </Card.Text>
        </Card.Body>
        <ListGroup className="list-group-flush">
          <ListGroup.Item> Energy{data.energy_value} {data.energy_unit}</ListGroup.Item>
          <ListGroup.Item>Protein{data.proteins_value} {data.proteins_unit}</ListGroup.Item>
          <ListGroup.Item>  Carbohydrates: {data.carbohydrates_value}{" "}
              {data.carbohydrates_unit}</ListGroup.Item>
          <ListGroup.Item>  Fat:{data.fat_value} {data.fat_unit}{" "}</ListGroup.Item>

        </ListGroup>
        <Card.Body>
          <Card.Link href="#">Card Link</Card.Link>
          <Card.Link href="#">Another Link</Card.Link>
        </Card.Body>
      </Card>
    </div>
  );
}

export default About;
